  false,\n\t\"url\": null,\n\t\"notes\": \"These data were collected under a cooperative
  agreement with the Massachusetts Office of Coastal Zone Management (CZM) and the
  U.S. Geological Survey, Coastal and Marine Geology Program, Woods Hole Science Center.
  Initiated in 2003, the primary objective of this program is to develop regional
  geologic framework information for the management of coastal and marine resources.
  Accurate data and maps of sea-floor geology are important first steps toward protecting
  fish habitat, delineating marine reserves, and assessing environmental changes due
  to natural or human impacts. The project is focused on the inshore waters (5-30m
  deep) of Massachusetts between the New Hampshire border and Cape Cod Bay. Data collected
  for the mapping cooperative have been released in a series of USGS Open-File Reports<http://woodshole.er.usgs.gov/project-pages/coastal_mass/html/current_map.html>.
  This spatial dataset is from the Cape Ann and Salisbury Beach Massachusetts project
  area. They were collected in two separate surveys in 2004 and 2005 and cover approximately
  325 square kilometers of the inner continental shelf. High resolution bathymetry
  and backscatter intensity were collected in 2004 and 2005. Seismic profile data,
  sediment samples and bottom photography were also collected in 2005.\",\n\t\"license_title\":
